import React from 'react';
import './App.css';
import { Container, Row, Col } from 'react-bootstrap';
import NavigationBar from './Components/NavigationBar';
import Bienvenue from './Components/Bienvenue'; // Make sure the path matches the location of your Bienvenue.js file

function App() {
  return (
    <div className="App">
      <NavigationBar />
      <Container>
        <Row>
          <Col lg={12}>
            <Bienvenue />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
